CORT CLASSIC TC-BIM ELECTRIC GUITAR
&nbsp;
In the Classic TC you will find an instrument that has a timeless classic design, but with just the right elements of evolution. Painstakingly designed by Hugh Manson and his Manson Guitar Works team in the UK, the Classic TC elicits passion as soon as you strap it on. Below you can explore the careful steps taken to make this perfectly evolved classic.
&nbsp;ERGONOMIC BODY CONTOUR
The body styling on the MS Series guitars was designed by Hugh Manson, with him considering each detail for these instruments. Both comfort and appearance was enhanced with an elegantly contoured arm cut on the top. The back has a "tummy cut" as a key comfort evolution feature. This modification to the back has been carefully laid out on the bodies of the MS guitars for maximum comfort without removing unnecessary amounts of wood. The lines of the Manson designed body are graceful for aesthetic beauty as well as for ergonomic considerations.
&nbsp;CONTROL PLATE &amp; HARDWARE
Often overlooked, the control plate and hardware not only provide functionality but contribute significantly to the sound of the guitar as well as enhanced playing experience. The blade 3-way switch so common on guitars of this style has been replaced with a toggle switch. Even the exact travel of the switch was precisely defined by Mr. Manson to maximize playability. The bridge selected for the Classic TC has six individual saddles designed to enhance intonation and string height adjustment.&nbsp;
